/*Table structure for table `packages` */

DROP TABLE IF EXISTS `packages`;

CREATE TABLE `packages` (
  `id_packages` int(11) NOT NULL AUTO_INCREMENT,
  `destinationId` int(11) DEFAULT NULL,
  `subpackage_data` longtext DEFAULT NULL,
  PRIMARY KEY (`id_packages`),
  KEY `asfdafafafafafa` (`destinationId`),
  CONSTRAINT `asfdafafafafafa` FOREIGN KEY (`destinationId`) REFERENCES `destination` (`id_destination`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `packages` */

/*Table structure for table `review` */

DROP TABLE IF EXISTS `review`;

CREATE TABLE `review` (
  `id_review` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) DEFAULT NULL,
  `destinationId` int(11) DEFAULT NULL,
  `rating` int(11) DEFAULT NULL CHECK (`rating` between 1 and 5),
  `comment` text DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `eventId` int(11) DEFAULT NULL,
  PRIMARY KEY (`id_review`),
  KEY `user_id` (`userId`),
